CREATE EXTENSION IF NOT EXISTS timescaledb;

create table if not exists historical_prices
(
    cryptocurrency_id integer   not null,
    price             double precision,
    volume_24h        double precision,
    market_cap        double precision,
    time              timestamp not null
);

select create_hypertable('historical_prices', 'time');

create index if not exists historical_prices_time_idx
    on historical_prices (time desc);

create index if not exists historical_prices_cryptocurrency_id_index
    on historical_prices (cryptocurrency_id desc);




